/*Data for the table `pr_artist` */

insert  into `pr_artist`(`id`,`seller`,`heading`,`subheadning`,`story`,`banner`,`status`) values (3,'32','CELEBRATING THE STRENGTHS, TALENT, AND PASSION OF OUR PHOTORUNNER ARTISTS. ','  Whether they&#039;re traveling the world or shooting right in their home of Estonia, photographer Rasmus Jurkatam and videographer Janek Toomikas work as a team to capture authentic, meaningful moments. Learn more about June&rsquo;s Signature Artists of the Month. ','&lt;div class=&quot;container&quot;&gt;\r\n&lt;h3 class=&quot;col-md-12 section_head&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;&lt;span style=&quot;color:rgb(64, 224, 208)&quot;&gt;Rasmus Jurkatam and Janek Toomikas have a lot of similarities &amp;mdash; they are both film fanatics, have grandfathers who were amateur photographers, and share a love of travel. But there&amp;rsquo;s one thing in particular that unites them more than anything else: a strong passion for visual language.&lt;/span&gt;&lt;/span&gt;&lt;/h3&gt;\r\n&lt;/div&gt;\r\n','608c7f61927747648c6d97efcfa41db4.jpg','1'),(4,'28','THIS IS A TEST STORY','A WATERMARK STORY','&lt;p&gt;Who is this man? This is a test. Photorunner open soon&lt;/p&gt;\r\n','ad210d9888a55c5f21f24b233fbbb3d1.jpg','1'),(5,'40','ONE MORE TESTSTORY','   He travel from job to job with his plane. He work when and where he want.','&lt;p&gt;bla bla bla &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n','c7dff5f5e590faab6a620963a814be97.jpg','1'),(6,'28','THIS IS A TEST STORY 2','Hire me','&lt;p&gt;&lt;strong&gt;Hello folks.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:courier new,courier,monospace&quot;&gt;&lt;strong&gt;Next time you hire a photographer, hire me for free.&amp;nbsp;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:comic sans ms,cursive&quot;&gt;Yes yes fonttest&lt;/span&gt;&amp;nbsp;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;http://www.photorunner.no/admin/ckeditor/plugins/smiley/images/regular_smile.png&quot; style=&quot;height:23px; width:23px&quot; title=&quot;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n','7b01bebd8f2b625f013cd198a050b125.jpg','1'),(7,'28','GQ - 20 000 dollars Wedding-Photographer','Master Weddings','&lt;p&gt;A &amp;nbsp;picture says more than 1000&amp;nbsp;words.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Call us 0047 98844016 for booking your wedding&lt;/p&gt;\r\n','8b564260676872457151238e4e322555.jpg','1');

