insert  into `pr_pages`(`id`,`title`,`headning`,`description`,`status`) values (1,'About Us','Photorunner  Provides 3 click Payment Galleries for Photographers','&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;\r\n&lt;div style=&quot;font-size: 16px; margin-top: 50px;&quot;&gt;\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Dear Customers&lt;/p&gt;\r\n&amp;nbsp;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:calibri,sans-serif&quot;&gt;PhotoRunner is a group og independent professional photographers, using &amp;nbsp;the uniqe 3 step system.&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;PhotoRunner provides 3 step&amp;nbsp;payment galleries for photographers. As a Customer, you recive professional&amp;nbsp;photos for us in sosial media etc, &amp;nbsp;just after they are taken.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;1.Upload&amp;nbsp; 2.Set price&amp;nbsp; 3:Send photo link to the customer. The watermark disappears when the customer pays with creditcard, PayPal or SMS (Norwegian phone numbers).&lt;/p&gt;\r\n\r\n&lt;p&gt;Photorunner is created and owned by FHE FOTO, Norway. Our customers needs for quick access to photos for Facebook and other medias during events made us develop Photorunner. This is a payment system that ensures the photographers intellectual rights with one payment brand, PHOTORUNNER. The watermark will disappear once payment is completed, and customers will have access to web size-photos or full resolution photos only a few minits after the photos are done. We also offer prints. Payments are handled securely by Stripe (www.stripe.com),&amp;nbsp; and customers have their own secure, private photo gallery.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Registering Photographers.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;PhotoRunner is made for helping photographers and theyr customers with the payment issue. We welcome all professional photographers. Fulltime and parttime photographers. The New Way of Selling and Buying Photos&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n',1),(2,'Press','Press-photos','&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width:90%; margin-left:auto; margin-right:auto;&quot;&gt;\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;\r\n&lt;h2&gt;&amp;nbsp;&lt;/h2&gt;\r\n\r\n&lt;h2&gt;Dear PhotoRunner&amp;nbsp;user,&lt;/h2&gt;\r\n\r\n&lt;p&gt;We are on of the world&amp;nbsp;largest distributer of photographers, &amp;nbsp;and sell basicly photos directly from photographers to customer. On the wall our photographers can publish international&amp;nbsp;media. In addition, we represent over 3000 independent&amp;nbsp;freelancers, many priced in different categories-art - press - advertising. They use PhotoRunner`s salesgalleries, and offer fast-photos for Facebook and other social media. It means you can stop the photographer marked with PHOTORUNNER ikon&amp;nbsp;on the street, and get a portrait. We are attracted from&amp;nbsp;photo agencies from around the world. In our digital archives we have unike images. This archive open August 2017.&amp;nbsp;During summer&amp;nbsp;2017 we offer videos. Find a photographer with a PhotoRunner pin, and you get delivered qualityphotos just after they been taken. Or search one from our Photographer list. To see the complete list of photographers, you must register as a buyer&lt;/p&gt;\r\n\r\n&lt;p&gt;We have also an online PS team, that suport and&amp;nbsp;can ajust photos while the photographer is doing his shots.&lt;/p&gt;\r\n\r\n&lt;p&gt;Meet the future with PhotoRunner&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Team PhotoRunner&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n',1),(3,'Careers','Make Your Own Carrier with PhotoRunner','&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width:90%; margin-left:auto; margin-right:auto;&quot;&gt;\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;\r\n&lt;h3&gt;&lt;span style=&quot;font-size:11.0pt&quot;&gt;&amp;quot;Start living as a photographer today with PhotoRunner`s sale system.&amp;quot;&lt;/span&gt;&lt;/h3&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;color:#00B050; font-family:calibri,sans-serif&quot;&gt;Work wherever you are, whenever you want with Photorunner&amp;rsquo;s sale system&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#00B050&quot;&gt;PhotoRunner&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;color:#00B050&quot;&gt; is a sales platform that facilitates transactions between photographers and customers. No more screenshots or stealing of photos, no more fuss with phone calls and e-mails &amp;nbsp;to get the payment in place. PhotoRunner provides the easy solution for photographers and customers alike.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#00B050&quot;&gt;Photographers:&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;color:#00B050&quot;&gt; Send the gallery directly &amp;nbsp;to your client. The images are protected by watermark till the customer pays. As soon as the payment is done, the watermark disappears.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;Sell jpg-files &amp;ndash;small&amp;nbsp; or large, or sell prints. You decide.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;You can work whenever you want, all over the world. The only thing you need is a camera with wifi transfer to your tablet or computer.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;1.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;color:#00B050&quot;&gt;Make gallery&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;2.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;color:#00B050&quot;&gt;Set price&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;3.&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;span style=&quot;color:#00B050&quot;&gt;Send gallery&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;PhotoRunner is perfect for all kinds of event photography.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#00B050&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;Sell your photos today - get payd tomorrow.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;We are attractive among consumers of photography: &amp;nbsp;&amp;nbsp;&amp;quot;We are very pleased with the new photographers base on photorunner.no, and felt that both the photographers list and the finally image result is on par with - and &amp;nbsp;much better than other companies offer&amp;quot;. Jereda Hansson, Liquidia Media.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;To become a PhotoRunner, you need to register. To be a member you need to send a CV of ten photos to post@photorunner.no&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n',1),(4,'Affiliates','In July, we offer FIneart print to our customers. Studio Technika, Oslo, Norway, has 30 years xperience printing Fine Art for wo','&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;If you choose the option Print FineArt, you are in company with the big names in&amp;nbsp; photography. Studio Technika in Oslo, Norway have more than thirty years xperience of printing for the most atractive galleries all over the world. New York, Berlin, Milano, Oslo.&amp;nbsp; with names like Per Maning, Tom Sandberg, Morten Krogvold.&amp;nbsp; All prints are carefully handmade, on the most delicate paper you wish. Chemical and Inchprint. You decide. Or let us choose for you.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;Cellphonephotos: We also offer a directly printline to the photolab. It means you can print FineArt of your favoritephotos.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;facilities&quot;&gt;\r\n&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;\r\n&lt;div style=&quot;font-size: 16px; margin-top: 50px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n',1),(5,'Plans and Pricing','RULES FOR USE','&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;facilities&quot;&gt;\r\n&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;PhotoRunner receives 10% of the amount paid.&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;RULES FOR USE:&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;\r\n&lt;p&gt;Conditions:&lt;/p&gt;\r\n\r\n&lt;p&gt;This image database belongs to PhotoRunner - Norwegian organization and trademark. PhotoRunner is a photo agency with more than 24000 photographers registered worldwide and has more than 3,000,000 registered users. PhotoRunner&amp;#39;s 3-stage sales system is aimed at professional photographers who engage in event photography such as running, cross country skiing, cycling and multisport etc., as well as product photography, company photography , weddings where the idea is that the photographer can sell as well as the customers can buy the pictures as soon as they are taken.&lt;/p&gt;\r\n\r\n&lt;p&gt;The images can be downloaded in ideal size for web usage at the price the photographer puts:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n* Non-commercial use: The images can be used freely on social media. The purchase does not allow you to use the pictures in newspapers, browse web pages for these in advertising etc.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;** Commercial Use: The price is valid for a given period of use if it is professional use. If the image is intended to be used as front page or in advertising, own prices / rates apply. Contacting PhotoRunner directly. Resale prohibited.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;*** Members of PhotoRuner automatically receive 10% discount on the given price. This applies to pre-registered members. The discount is given at &amp;quot;checkout&amp;quot;:&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;**** Resale Prohibited&lt;/p&gt;\r\n\r\n&lt;p&gt;***** Reproduction and alteration of images is prohibited&lt;/p&gt;\r\n\r\n&lt;p&gt;****** Screenshot Prohibited: In cases where images that have been shared and used with watermark online, the responsible person will be charged with a penalty fee and the &amp;nbsp; &amp;nbsp;case will be reported to the police.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;****** The pictures should be used according to the rules of the placement. Norwegian law is the debt. In addition, the law on image use in the country where the images are used, applies if they are published outside Norway.&lt;/p&gt;\r\n\r\n&lt;p&gt;******* Customers / buyers who tick for OPERATING FOR COMMERCIAL USE will receive 20% of the sales price.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\nThe images will be available as soon as the payment transaction has been correct. Then the watermark will disappear and you can share the pictures from &amp;quot;My Gallery&amp;quot;, or download them to your PC / tablet or phone.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;For commercial use of the images, they must be labeled with the photographer&amp;#39;s name and PhotoRunner in this way:&lt;br /&gt;\r\nPhoto: Photographer name / PhotoRunner.&lt;/p&gt;\r\n\r\n&lt;p&gt;Personal information:&lt;br /&gt;\r\nPhotoRunner does not share personal information such as mail or phone numbers. Information that may be associated with you as a person will never be made available to other businesses or connected with other external registers. PhotoRunner&amp;#39;s web pages are https secured-encrypted.&lt;/p&gt;\r\n\r\n&lt;p&gt;brief Information&lt;br /&gt;\r\nWhen shopping with PhotoRunner, the payment is processed by Stripe (www.stripe.com), which is a secure electronic payment solution for Visa and MasterCard / Eurocard. All card information is kept in accordance with the card company&amp;#39;s regulations.&lt;/p&gt;\r\n\r\n&lt;p&gt;WWW.STRIPE.COM&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Cancellation:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\ncomplaints:&lt;br /&gt;\r\nIf there is a defect in the image / images, you must provide PhotoRunner with a written email to post@photorunner.no within a reasonable time after you discover it, or by posting that you wish to claim the defect. PhotoRunner will then give you information on what to do next. The rules on complaints can be found in the &amp;quot;Consumer Procurement Act&amp;quot; (Consumer Procurement Act).&lt;/p&gt;\r\n\r\n&lt;p&gt;Right of withdrawal:&lt;br /&gt;\r\nAccording to the law of cancellation, the deadline applies from the day the buyer received the goods and 14 days in advance. If you wish to regret the purchase, please let us know by email or by letter. You will then refund what you have paid. We note that at the same time you lose all right to use the image / images.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Sincerely&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;PhotoRunner&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&amp;nbsp;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;&lt;span style=&quot;font-size:12px&quot;&gt;NORSK:&lt;/span&gt;&lt;/h3&gt;\r\n\r\n&lt;h3&gt;Betingelser&lt;/h3&gt;\r\n\r\n&lt;p&gt;Denne bildedatabasen tilh&amp;oslash;rer PhotoRunner &amp;ndash; norsk organisasjon og varemerke . PhotoRunner er et bildenyr&amp;aring; med 24000 fotografer registrert p&amp;aring; verdensbasis, og har mer enn 3&amp;nbsp;000 000 registrerte brukere.. PhotoRunners 3 trinns salgssystem &amp;nbsp;retter seg mot profesjonelle fotografer som driver med eventfotografering som l&amp;oslash;ping, langrenn, sykkel og multisport osv., samt produktfoto, firmafotografering, bryllup der ideen er at fotografen kan selge, samt kundene kan kj&amp;oslash;pe bildene straks de er tatt.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Bildene kan lastes ned&amp;nbsp;i ideell st&amp;oslash;rrelse for nettbruk til den pris fotografen setter:&amp;nbsp;&lt;/strong&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\n* Ikke-kommersiell bruk:&amp;nbsp;Bildene kan brukes fritt p&amp;aring; sosiale medier.&amp;nbsp;Kj&amp;oslash;pet gir ikke adgang til &amp;aring; bruke bildene i aviser, blader p&amp;aring; nettsider for disse i reklame etc.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n** Kommersiell bruk: Prisen gjelder for en gitt periodes bruk om det er profesjonell bruk. Hvis bildet er tenkt brukt som forside eller i reklame gjelder egne priser/satser.&amp;nbsp;Ta da kontakt med PhotoRunner direkte.&amp;nbsp;Videresalg forbudt.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;*** Medlemmer i PhotoRuner f&amp;aring;r automatisk 10% rabatt av oppgitt pris. Dette gjelder forh&amp;aring;ndsregistrerte medlemmer.&amp;nbsp;Rabatten gis ved &amp;quot;checkout&amp;quot;: &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;****Videresalg Forbudt&lt;/p&gt;\r\n\r\n&lt;p&gt;***** Bearbeiding og forandring p&amp;aring; bilder er forbudt&lt;/p&gt;\r\n\r\n&lt;p&gt;****** Screenshot Forbudt: I tilfeller der&amp;nbsp;bilder som er blitt delt og brukt med vannmerke p&amp;aring; nettet, vil ansvarlige bli fakturert med straffegebyr, og saken bli politianmeldt.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;****** Bildene skal brukes etter V&amp;AElig;R VARSOM PLAKATENS regler. Norsk lov er gjeldene. Dessuten gjelder lov om bilebruk i det land bildene brukes, dersom de publiseres utenfor Norge.&lt;/p&gt;\r\n\r\n&lt;p&gt;*******Kunder/kj&amp;oslash;pere som krysser av for TILLAT FOR KOMMERSIELL BRUK, vil motta 20% av salgssummen.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;br /&gt;\r\nBildene blir tilgjengelig s&amp;aring; snart betalingstransaksjonen har g&amp;aring;tt i orden.&amp;nbsp;Da vil vannmerket forsvinne, og man kan dele bildene fra &amp;quot;mitt galleri&amp;quot;, eller laste de ned i din pc/nettbrett eller telefon.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Ved kommersiell bruk av bildene skal de merkes med fotografens navn og PhotoRunner p&amp;aring; denne m&amp;aring;ten:&lt;br /&gt;\r\nFoto: Fotografens navn / PhotoRunner.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Personopplysninger&lt;/strong&gt;&lt;br /&gt;\r\nPhotoRunner deler ikke personopplysninger som mail eller telefonnumre. Opplysninger som kan knyttes til deg som person vil aldri bli gjort tilgjengelig for andre virksomheter eller koblet med andre eksterne register. PhotoRunners nettsider er https sikret-kryptert.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Kortinformasjon&lt;/strong&gt;&lt;br /&gt;\r\nN&amp;aring;r du handler hos PhotoRunner blir betalingen behandlet av Stripe(www.stripe.com), som er en sikker elektronisk betalingsl&amp;oslash;sning for Visa og MasterCard/Eurocard. All kortinformasjon blir oppbevart i henhold til kortselskapets regelverk.&lt;br /&gt;\r\n&lt;br /&gt;\r\nWWW.STRIPE.COM&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;strong&gt;Avbestilling&lt;/strong&gt;&lt;br /&gt;\r\n&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Reklamasjon&lt;/strong&gt;&lt;br /&gt;\r\nDersom det foreligger en mangel ved bildet/bildene, m&amp;aring; du innen rimelig tid etter at du oppdaget den, gi PhotoRunner skriftlig melding til e-post&amp;nbsp;post@photorunner.no,&amp;nbsp;&amp;nbsp;eller per post om at du vil p&amp;aring;berope deg mangelen. PhotoRunner vil da gi deg informasjon om hva du skal gj&amp;oslash;re videre. Reglene om reklamasjon finnes i &amp;laquo;Lov om forbrukerkj&amp;oslash;p&amp;raquo; (forbrukerkj&amp;oslash;psloven).&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Angrerett&lt;/strong&gt;&lt;br /&gt;\r\nI f&amp;oslash;lge angrerettloven gjelder angrefristen fra den dagen kj&amp;oslash;peren mottok varen og 14 dager fremover. Dersom du vil angre p&amp;aring; kj&amp;oslash;pet, gir du oss beskjed om dette enten per e-post eller i brev. Du vil da f&amp;aring; tilbakef&amp;oslash;rt det du har betalt. Vi gj&amp;oslash;r oppmerksom p&amp;aring; at du samtidig mister all rett til bruk av bildet/bildene.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Vennlig Hilsen&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;PhotoRunner&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;width: 90%; margin-right: auto; margin-left: auto;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n',1),(6,'Corporate accounts','STRIPE - PAYPAL- Apple Pay -Studio Technika','&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;col-md-12 no-pading&quot;&gt;\r\n&lt;div style=&quot;width:90%; margin-left:auto; margin-right:auto;&quot;&gt;\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h1&gt;&lt;span style=&quot;font-size:48px&quot;&gt;&amp;nbsp;Apple Pay&lt;/span&gt;&lt;/h1&gt;\r\n\r\n&lt;p&gt;Make secure purchases in&amp;nbsp;stores, in&amp;nbsp;apps, and now on the&amp;nbsp;web with &lt;span style=&quot;font-size:16px&quot;&gt;PhotoRunner.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Apple Pay is simple to use and works with the devices you use&amp;nbsp;every day. Easily pay with your debit cards and credit cards with just a touch. And because your card details are never shared by Apple when you use Apple&amp;nbsp;Pay, making payments with your iPhone, Apple&amp;nbsp;Watch, iPad, and Mac is the safer, more private way&amp;nbsp;to&amp;nbsp;pay.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px&quot;&gt;As the first Photo Agency in the world, offer&amp;nbsp;PhotoRunner ApplePay. &amp;nbsp;Sell and buy the photos when they are taken.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;h1&gt;&amp;nbsp;&lt;/h1&gt;\r\n\r\n&lt;h1&gt;&lt;span style=&quot;font-size:72px&quot;&gt;&amp;nbsp;Stripe&lt;/span&gt;&lt;/h1&gt;\r\n\r\n&lt;h1&gt;&lt;span style=&quot;font-size:36px&quot;&gt;The new standard in online payments&lt;/span&gt;&lt;/h1&gt;\r\n\r\n&lt;p&gt;Stripe is the best software platform for running an internet business. We handle billions of dollars every year for forward-thinking businesses around the world.&lt;/p&gt;\r\n\r\n&lt;p&gt;Stripe builds the most powerful and flexible tools for internet commerce. Whether you&amp;rsquo;re creating a subscription service, an on-demand marketplace, an e-commerce store, or a crowdfunding platform, Stripe&amp;rsquo;s meticulously-designed APIs and unmatched functionality help you create the best possible product for your users. Hundreds of thousands of the world&amp;rsquo;s most innovative technology companies are scaling faster and more efficiently by building their businesses on Stripe.&lt;/p&gt;\r\n\r\n&lt;h1&gt;You&amp;rsquo;re in good company.Join 100,000+ businesses on&amp;nbsp;Stripe. &amp;nbsp;www.stripe.com&lt;/h1&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:48px&quot;&gt;PayPal&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;One solution for all requirements.&lt;br /&gt;\r\nDo you want to offer PayPal as a payment solution Customers.&amp;nbsp;Discover &amp;nbsp;solutions for professional photographers and theyr customers.&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n&lt;/ul&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;\r\n&lt;p&gt;&lt;span style=&quot;font-size:48px&quot;&gt;Studio Technika&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Studio Technika is PhotoRunners supplier of quality print.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;Studio Technika - A photo lab for photographers.&lt;br /&gt;\r\nOur core activity is production of images of the highest quality.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our lab is digital and analogue.&lt;/p&gt;\r\n\r\n&lt;p&gt;In our photo lab developes&amp;nbsp;all types of film formats. We hang machines, color-negative, b / w-negative and slide negative film.&lt;/p&gt;\r\n\r\n&lt;p&gt;Film scanning from negative and slides in the highest quality, are delivered to the customer as rawscan or ProScan.&lt;br /&gt;\r\nWe scann also paperoriginals&amp;nbsp;up to 32x45 cm, in the desired size.&lt;/p&gt;\r\n\r\n&lt;p&gt;We make analog and digital copies of the sheet - and roll up to 162 cm width. Copies are made on the best available materials.&lt;/p&gt;\r\n\r\n&lt;p&gt;At Studio Technika we have a special assembly and Rammeverksted(frame specialist)&amp;nbsp;to offer best quality to the finished product.&lt;br /&gt;\r\nWe assemble the plates for framing or right on the wall. Our framer offers a selection profiles suitable for framing of photography.&lt;br /&gt;\r\nWe sell&amp;nbsp;&amp;nbsp;film in all formats and has a good range of chemicals and photo paper in our outlets.&lt;/p&gt;\r\n\r\n&lt;p&gt;We are wery happy for the corporation with PhotoRunner, and grant high quality on all images. All images passing our lab, get the little xtra attention. Photos get printet with chemical bath, or with our high quality Epson inch printers.&lt;/p&gt;\r\n\r\n&lt;p&gt;We are also spesialised in large print from Cellphones&lt;/p&gt;\r\n\r\n&lt;p&gt;Studio Technika was established in 1980 and have the largest printcapasity in&amp;nbsp;Norway. Analog and Digital Prints.&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;www.paypal.com&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;www.stripe.com&lt;/div&gt;\r\n\r\n&lt;div style=&quot;font-size:16px; margin-top:50px;&quot;&gt;www.bilder.as&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n',1);

