CREATE TABLE `pr_payments` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `buyer` varchar(128) NOT NULL,
  `photographer` varchar(128) NOT NULL,
  `photo` varchar(128) NOT NULL,
  `type` varchar(128) NOT NULL,
  `txnid` varchar(128) NOT NULL,
  `payment` varchar(128) NOT NULL,
  `amount` varchar(128) NOT NULL,
  `review` bigint(20) NOT NULL DEFAULT '0',
  `currency` varchar(64) NOT NULL,
  `download` varchar(64) NOT NULL,
  `status` varchar(64) NOT NULL DEFAULT '1',
  `size` varchar(64) NOT NULL,
  `date` varchar(128) NOT NULL,
  `filename` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=167 DEFAULT CHARSET=latin1;

