/*Table structure for table `pr_photos` */

DROP TABLE IF EXISTS `pr_photos`;

CREATE TABLE `pr_photos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `seller` bigint(20) NOT NULL,
  `category` bigint(20) NOT NULL,
  `gallery` bigint(20) NOT NULL,
  `name` varchar(256) NOT NULL,
  `webfile` varchar(128) NOT NULL,
  `printfile` varchar(128) NOT NULL,
  `webfileprice` decimal(10,2) NOT NULL,
  `printfileprice` decimal(10,2) NOT NULL,
  `printfilepricea3` decimal(10,2) NOT NULL,
  `printfilepricea4` decimal(10,2) NOT NULL,
  `printfilepricea5` decimal(10,2) NOT NULL,
  `webfilepriceeuro` decimal(10,2) NOT NULL,
  `printfilepricea3euro` decimal(10,2) NOT NULL,
  `printfilepricea4euro` decimal(10,2) NOT NULL,
  `printfilepricea5euro` decimal(10,2) NOT NULL,
  `othertitle` varchar(128) NOT NULL,
  `otherprice` decimal(10,2) NOT NULL,
  `otherpriceeuro` decimal(10,2) NOT NULL,
  `imagewidth` varchar(128) NOT NULL,
  `imageheight` varchar(128) NOT NULL,
  `massage` text NOT NULL,
  `date` varchar(128) NOT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '1',
  `sellwebpublik` varchar(64) NOT NULL,
  `sellprintpublik` varchar(64) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2543 DEFAULT CHARSET=latin1;

